import React from "react";
import "./Card.scss";
import spade from "../../images/spade.png"

const Card = (props) => {
  const { CardArr } = props;

  const Cards = CardArr.map((card, index) => {
    return (
      <div key={index} className="card">
        <h1>{card.value}</h1>
        if (card.suit == spades)
        <img src ={spade}
          />
      </div>
    );
  });

  return <div className="Cards">{Cards}</div>;
};

export default Card;
